const sixtyColor = "rgba(27, 34, 50, 1)";
const thirtyColor = "rgba(196, 155, 187, 1)";
const tenColor = "rgba(215, 204, 177, 1)";

export const theme = {
  bgColor: sixtyColor,
  color: tenColor,
  accent: thirtyColor,
};
